    false,nt"url": null,nt"notes": "This narrative report for Des Lacs National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1957.
    The report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, and raptors- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, and wildfires.
    Resource management is outlined; topics include fur harvesting. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, and Refuge participation.
    N-R forms and photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
